                                    <p className="font_7">&nbsp;</p>
                                    <p className="font_7"><span style={{fontFamily: 'helvetica-w01-light,helvetica-w02-light,sans-serif'}}>Lquipe de Fais le trottoir rassemble des connaisseurs et praticiens passionns de graffiti qui oeuvrent depuis plusieurs annes pour une meilleure (re)connaissance de ce mouvement en agissant  diffrents niveaux: organisation de visites guides tout public, organisation dvnements (K.A.T.), ralisation de documentaire, parution de fanzines, participation  des dbats-confrences, ralisations de fresques, mise en rseau des acteurs de la scne... </span></p>
                                    <p className="font_7">&nbsp;</p>
                                    <p className="font_7"><span style={{fontFamily: 'helvetica-w01-light,helvetica-w02-light,sans-serif'}}>A travers toutes ces actions, les membres de lquipe tentent de mettre en vidence les aspects positifs du graffiti&nbsp;et de&nbsp;transmettre  un public large une vision objective la plus authentique possible, qui dpasse les strotypes lis  ces pratiques. Le but tant de faire valoir la richesse et la diversit de la scne graffiti et de dbloquer des moyens pour ses acteurs.</span></p>
                                    <p className="font_7">&nbsp;</p>
                                    <p className="font_7"><span style={{fontFamily: 'helvetica-w01-light,helvetica-w02-light,sans-serif'}}>Certaines activits sont menes en partenariat avec <span style={{textDecoration: 'underline'}}><a href="http://www.lezarts-urbains.be/" target="_blank" data-content="http://www.lezarts-urbains.be/" data-type="external" rel="undefined">Lezarts Urbains</a></span>, <span style={{textDecoration: 'underline'}}><a href="http://www.chezzelle.be/" target="_blank" data-content="http://www.chezzelle.be/" data-type="external" rel="undefined">Chez Zelle ASBL</a></span>, <span style={{textDecoration: 'underline'}}><a href="http://www.olln.be/" target="_blank" data-content="http://www.olln.be/" data-type="external" rel="undefined">la ville d'Ottignies Louvain-la-Neuve</a></span>, <span style={{textDecoration: 'underline'}}><a href="http://www.urbana-project.com/" target="_blank" data-content="http://www.urbana-project.com/" data-type="external" rel="undefined">Urbana ASBL</a></span>, <span style={{textDecoration: 'underline'}}><a href="http://www.costik.be/" target="_blank" data-content="http://www.costik.be/" data-type="external" rel="undefined">Costik ASBL,&nbsp;</a></span></span><span style={{fontFamily: 'helvetica-w01-light, helvetica-w02-light, sans-serif', textDecorationLine: 'underline'}}><a href="https://www.maisoncfc.be/fr/" target="_blank" data-content="https://www.maisoncfc.be/fr/" data-type="external" rel="undefined">CFC Editions.</a></span><span style={{fontFamily: 'helvetica-w01-light, helvetica-w02-light, sans-serif'}}>..</span></p></div><div style={{width: '500px', height: '94px', overflow: 'hidden', minHeight: '94px', minWidth: '500px'}} data-has-iframe="true" className="style-jr7ipbvb" id="comp-imjip665"><iframe scrolling="no" frameBorder={0} allow="autoplay; camera; microphone; geolocation; vr" allowTransparency="true" allowFullScreen name="comp-imjip665" style={{width: '500px', height: '94px', minHeight: '94px', minWidth: '5